import logo from './logo.png';
import './App.css';
import React, {useState} from "react";
import { ButtonGroup, Button, Row, Container, Col} from 'react-bootstrap';
import axios from 'axios'
import { Redirect } from "react-router-dom";
import { useHistory } from "react-router-dom";
import {Link} from 'react-router-dom'

function Enter() {
    let history = useHistory();
    const enter = () => {
        history.push('./login')
    };
    return (
        <div className = 'enter'>
            <img src={logo}></img>
            <ButtonGroup size = "1g" className = "reglogin">
                <Button variant="outline-primary" /*onClick = {enter}*/>Enter To Search</Button>
            </ButtonGroup>
            <Link to="/login">
                <Button className="e-button" type="primary">Back to logixn page</Button>
            </Link>
        </div>
    )
}

export default Enter;
